import React, { PureComponent } from "react";
import ReactDOM from "react-dom";
import moment from "moment";
import styled from "styled-components";

import WeekCalendar from "./components/WeekSchedular";
import ModalCalendar from "./components/ModalCalender";

export const selectedEvents = [
  {
    start: moment().add(1, "days").hour(9).minute(0),
    end: moment().add(1, "days").hour(10).minute(0)
  },
  {
    start: moment().add(1, "days").hour(10).minute(0),
    end: moment().add(1, "days").hour(11).minute(0)
  },
  {
    start: moment().add(2, "days").hour(10).minute(0),
    end: moment().add(2, "days").hour(11).minute(0)
  }
];

const StyledWeekCalendar = styled(WeekCalendar)`
  margin: 50px;
`;

class App extends PureComponent {
  render() {
    return (
      <WeekCalendar
        useModal={true}
        modalComponent={() => {
          return <ModalCalendar />;
        }}
      />
    );
  }
}

const rootElement = document.getElementById("root");
ReactDOM.render(<StyledWeekCalendar />, rootElement);
